import React from "react";

const Register = () => {
  return (
    <div>
      <div className="row g-0">
        <div className="col-md-8 form-banner ">
          <img src="./assets/images/banner2.jpg" alt="registerImage" />
        </div>
        <div className="col-md-4 form-container">
          <Form
            formTitle={"Register"}
            submitBtn={"Register"}
            formType={"register"}
          />
        </div>
      </div>
    </div>
  );
};

export default Register;
